  def test_measure_unit_mul(self):
    # Measure (Explicit Error) * Unit
    if(True):
      # Measure Unitless * Unit
      if(True):
        # Normal Units
        if(True):
          # Value 1: Int
          assert isinstance( (  Measure(value=3,error=2)  *  Unit("cm")  ), Measure )
