    # Values & Certainties
    assert Measure("4(2)cm") /         "2"  == Measure("2(1)cm")
    assert (        "2"  / Measure("3(1)cm")).approx(Measure("0.66666(22222)cm^-1"))
    # Implied Uncertainty
