  def test_practical_div(self):
    assert (Measure("5cm")/Measure("1 min")).units == Unit("cm/min")
    assert Measure("26.85 \u00B0C") / Measure("26.85 \u00B0C") == Measure("1")
    assert Measure("5 carrot") / Measure("1 pig") == Measure("5 carrot / pig")